// src/Services.js
import React from 'react';
import Navbar from './Navbar';
import Footer from './Footer';
import CaseManagement from './CaseManagement';
import ClientCommunication from './components/ClientCommunication';
import DocumentSubmission from './components/DocumentSubmission';
import CourtDateTracking from './components/CourtDateTracking';
import './Services.css';

const Services = () => {
    return (
        <div className="services-page">
            <Navbar />
            <div className="container">
                <h1>Our Services</h1>
                <CaseManagement />
                <ClientCommunication />
                <DocumentSubmission />
                <CourtDateTracking />
            </div>
            <Footer />
        </div>
    );
};

export default Services;
